  }

  // hideText() {
  //   this.setState({show: !this.state.show})
  // }

  render() {    
    let ul = this.state.show.map((item, index) => {
      return <li>{item}</li>
    })

    return 
    <div>
      <ul>
        {ul}
      </ul>
      <button>Click</button>
    </div>
  }
}

export default App;
